		methods: {
			imgCompute() {
				const getSystemInfo = uni.getSystemInfoSync()
				const {
					windowWidth,
					windowHeight
				} = getSystemInfo; //屏幕可视宽高
				let imageAdapt = (960 * windowWidth) / 1125; //计算根据宽度的自适应的高度
				this.size = `${windowWidth}px ${Math.ceil(imageAdapt)}px`
				this.setHeight = `${Math.ceil(imageAdapt)}px`
				this.setTop=`${Math.ceil(imageAdapt)-40}px`
				// console.log(this.size);
			},
			goToHistory(){
